/**
 * Stores the base64 data for the icons used in the Application Launcher veiw.
 * 
 * @author Jeff Martin
 * @since 21.1
 */

// TODO: The icon data should be provided by the server and stored in the database.
// If the data is supplied by the server this class can be removed.
Ext
		.define(
				'AppLauncher.ui.IconData',
				{
					singleton : true,

					iconData : {
						Maintenance : {
							data : {
								large : '',
								small : ''
							}
						},
						AssetAndEquipmentSurvey : {
							data : {
								large : '',
								small : ''
							}
						},
						SpaceBook : {
							data : {
								large : '',
								small : ''
							}
						},
						ConditionAssessment : {
							data : {
								large : '',
								small : ''
							}
						}
					},

					getIconData : function(applicationId) {
						if (Ext.isDefined(this.iconData[applicationId])) {
							if (Ext.os.deviceType === 'Phone') {
								return this.iconData[applicationId].data.small;
							} else {
								return this.iconData[applicationId].data.large;
							}
						} else {
							// Default icon
							// We are using the Maintenance icon
                            if (Ext.os.deviceType === 'Phone') {
                                return this.iconData.Maintenance.data.small;
                            } else {
                                return this.iconData.Maintenance.data.large;
                            }
						}
					}
				});
